import { Typography } from "@mui/material";
import image from "./images/wifi_offline.webp"
function Offline(){
    return (
        <>
            <Stack>
                <Typography variant='h3'>Offline</Typography>
                <img src={image} alt="wifi"/>
            </Stack>
        </>
    )
}
export default Offline;
